import NavBar from "./components/NavBar";
import "./App.css";
import { BrowserRouterRoute, Router, Switch } from "react-router-dom";

function App() {
  return (
    <Router>
      <NavBar />
      <Switch>
        <Route path="/food" />
      </Switch>
    </Router>
  );
}

export default App;
